// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.22 <0.9.0;

contract test {

    struct Corp {
        string  Info;
        int     CERs;
        int     Quota;
        int     Money;
        bool    Type;
    }

    struct tradeQuest {
        address fromCorpAddr;
        bool    typeOfAsset;
        int     amountOfAsset;
    }

    //合约的拥有者
    address public owner;
    address[] corpList;
    // type:
    //      0: 控排 出售
    //      1: 减排 买入
    mapping (address => Corp) corpMap;
    mapping (address => tradeQuest[]) tradeQuestMap;

    constructor() public {
       owner = msg.sender;
    }

    function initCorp(address newCorpAddr, string memory info, bool ty) public payable returns (bool) {
       /* require(msg.sender == owner && corpNotExist(newCorpAddr)); */
       require(msg.sender == owner);
       corpList.push(newCorpAddr);
       Corp memory tmpCorp = Corp(info, 100, 100, 0, ty);
       corpMap[newCorpAddr] = tmpCorp;
       return true;
    }

    function queryCorp(address corpAddr) public returns (Corp memory) {
        return corpMap[corpAddr];
    }

    function initTradeQuest(address toCorpAddr, bool typeOfAsset, int amountOfAsset) public {
        tradeQuestMap[toCorpAddr].push(tradeQuest(msg.sender, typeOfAsset, amountOfAsset));
    }

    function transferCERs(address fromCorp, address toCorp, int CERs, int Money) public payable {
       require(corpMap[fromCorp].CERs > CERs);
       corpMap[fromCorp].CERs -= CERs;
       corpMap[fromCorp].Money += Money;

       corpMap[toCorp].CERs += CERs;
       corpMap[toCorp].Money -= Money;
    }

    function transferQuota(address fromCorp, address toCorp, int Quota, int Money) public payable {
       require(corpMap[fromCorp].Quota > Quota);
       corpMap[fromCorp].Quota -= Quota;
       corpMap[fromCorp].Money += Money;

       corpMap[toCorp].Quota += Quota;
       corpMap[toCorp].Money -= Money;
    }
}
